import Footer from 'components/common/Footer';
import TopBanner from 'components/common/TopBanner';
import { HomePageComponentsWrapper } from 'pages/home';
import ArticleWrapper from 'pages/home/ArticleWrapper';
import ArticleWrapper2 from 'pages/home/ArticleWrapper2';
import GridArticle from 'pages/home/GridArticle';
import React, { Suspense, useEffect, useState } from 'react';
import styled from 'styled-components';
import { CustomGet, fetchJobFreedData } from 'utils/api';
import {
	Article3Minutes,
	ArticleCareerEvent,
	CompanyDummy,
	ThemeCompanyDummy,
} from 'utils/mockData';
import CompanyRec from './CompanyRec';
import FeaturePosition from './FeaturePosition';
import NotLoginArticle from './NotLoginArticle';
import Shortcut from './Shortcut';

const companyByTagResult = fetchJobFreedData();

function ProfileDetails() {
	const user = companyByTagResult.user.read();
	console.log(user);
	return <h1>로딩됨</h1>;
}

function JobsfeedPage() {
	const [topBannerData, setTopBannerData] = useState(null);
	const [companyByTag, setCompanyByTag] = useState(null);

	useEffect(() => {
		const topbannerResult = CustomGet({
			url: 'web/jobsFeed/advertisments',
		});
		// companyByTagResult = CustomGet({
		// 	url: 'web/jobsFeed/companyByTag',
		// });

		// companyByTagResult.then((res) => {
		// 	console.log(res);
		// 	switch (res.code) {
		// 		case 1005:
		// 			setCompanyByTag(res.result);
		// 			break;
		// 		default:
		// 	}
		// });

		topbannerResult.then((res) => {
			switch (res.code) {
				case 1005:
					setTopBannerData(res.result);
					break;
				default:
			}
		});
	}, []);
	return (
		<HomePageComponentsWrapper>
			<Suspense fallback={<h1>Loading profile...</h1>}>
				<ProfileDetails />
			</Suspense>

			<TopBanner data={topBannerData} />
			<Shortcut />
			<NotLoginArticle />
			<div className="divider" role="separator" />

			<Suspense fallback={<h1>Loading profile...</h1>}>
				<div className="featured-joblist">
					<CompanyRec
						company
						title="#연봉이 최고의 복지"
						icon="https://static.wanted.co.kr/images/tags/634f02e0-9f6e-11ec-b909-0242ac120002.png"
						data={CompanyDummy}
					/>
				</div>

				<div className="featured-joblist">
					<CompanyRec
						company
						title="#퇴사율 10% 이하"
						icon="https://static.wanted.co.kr/images/tags/7d3cdb3c-9f6e-11ec-b909-0242ac120002.png"
						data={CompanyDummy}
					/>
				</div>
			</Suspense>

			<div className="divider" role="separator" />

			<div className="featured-joblist">
				<CompanyRec
					theme
					title="테마로 모아보는 요즘 채용"
					data={ThemeCompanyDummy}
				/>
			</div>
			<div className="divider" role="separator" />

			<div className="featured-joblist" style={{ marginBottom: '70px' }}>
				<FeaturePosition
					title="요즘 뜨는 포지션"
					data={ThemeCompanyDummy}
				/>
			</div>

			<Footer />
		</HomePageComponentsWrapper>
	);
}

export default JobsfeedPage;
